import React from "react";
import classes from "./ContentQuote.module.css"
import Card from "./card";

const ContentQuote=(props)=>{
  return (
    <Card >
        <p className={classes.quote}>{props.quote}</p>
    </Card>
  )
}

export default ContentQuote;
